public static int knapsack(int capacity, int [][] items) {
// 第一行表示背包容量
int[][] dp = new int[capacity + 1][items.length + 1];
// 第一列表示物品个数
for (int i = 1; i <= capacity; i++) {
dp[i][0] = 0;
}
for (int i = 1; i <= items.length; i++) {
dp[0][i] = 0;
}
// 填表
for (int i = 1; i <= capacity; i++) {
for (int j = 1; j <= items.length; j++) {
// 容量不足
if (i < items[j - 1][0]) {
dp[i][j] = dp[i][j - 1];
} else {
// 容量足够
dp[i][j] = Math.max(dp[i][j - 1], dp[i - items[j - 1][0]][j - 1] + items[j - 1][1]);
}
}
}
return dp[capacity][items.length];
}

public static int knapsack(int capacity, int [][] items) {
// 1. 定义状态数组
int[] dp = new int[capacity + 1];
// 2. 状态转移方程
for (int i = 0; i < items.length; i++) {
for (int j = capacity; j >= items[i][1]; j--) {
dp[j] = Math.max(dp[j], dp[j - items[i][1]] + items[i][0]);
}
}
