public static int shortest_path_length(Map<List<Node>, Integer> length_by_edge, Node startnode, Node goalnode) {
// We'll use the Dijkstra algorithm.
Map<Node, Integer> distance_by_node = new HashMap<>();
Map<Node, Node> previous_node_by_node = new HashMap<>();
Set<Node> unvisited_nodes = new HashSet<>();
unvisited_nodes.add(startnode);
distance_by_node.put(startnode, 0);
while (!unvisited_nodes.isEmpty()) {
Node current_node = null;
for (Node node : unvisited_nodes) {
if (current_node == null || distance_by_node.get(node) < distance_by_node.get(current_node)) {
current_node = node;
}
}
if (current_node == goalnode) {
break;
}
unvisited_nodes.remove(current_node);
for (Node neighbor : current_node.neighbors) {
int new_distance = distance_by_node.get(current_node) + length_by_edge.get(Arrays.asList(current_node, neighbor));
if (!unvisited_nodes.contains(neighbor)) {
continue;
}
if (distance_by_node.get(neighbor) == null || new_distance < distance_by_node.get(neighbor)) {
distance_by_node.put(neighbor, new_distance);
previous_node_by_node.put(neighbor, current_node);
}
}
}
int path_length = 0;
Node current_node = goalnode;
while (current_node!= startnode) {
Node previous_node = previous_node_by_node.get(current_node);
path_length += length_by_edge.get(Arrays.asList(previous_node, current_node));
current_node = previous_node;
